Body:
JUST IN: The 
@CFTC
 has filed suit against leading crypto exchange 
@binance
 and its CEO 
@cz_binance
. The price of #bitcoin is plunging on the news.
@oknightcrypto
 reports coindesk.com
CFTC Sues Binance, CZ Over 'Willful Evasion' of U.S. Laws, Unregistered Crypto Derivatives Products
The CFTC alleged Binance offered unregistered crypto derivatives products and directed U.S. customers to evade compliance controls through the use of VPNs.
